import '../css/page/opidex.css';


function OpiDex() {
  return (
    <div className="opidex">
       <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <div>
        <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="Hello World"
        />
          </div>
    </Box>
    </div>
  );
}

export default OpiDex;
